import p5 from 'p5'
import * as gl from './gifLinks.js'

const sketchFn = (s) => {
  let yOffset = 0

  s.setup = () => {
    s.createCanvas(s.windowWidth, 200)
    s.noStroke()
  }

  s.draw = () => {
    let xOffset = 0
    s.clear()
    s.fill("rgba(255, 255, 255, 1)")

    s.beginShape()

    for (let x = 0; x <= s.width; x += 10) {
      let y = s.map(s.noise(xOffset, yOffset), 0, 1, s.height - 100, s.height - 200)
      s.vertex(x, y)
      xOffset += 0.05
    }

    // patch up to window width
    s.vertex(s.width, s.map(s.noise(xOffset, yOffset), 0, 1, s.height - 100, s.height - 200))

    yOffset += 0.01
    s.vertex(s.width, s.height)
    s.vertex(0, s.height)
    s.endShape(s.CLOSE)
  }

  s.windowResized = () => {
    s.resizeCanvas(s.windowWidth, 240);
  }
}

const isMobileDevice = () => {
  return (typeof window.orientation !== "undefined") || (navigator.userAgent.indexOf('IEMobile') !== -1);
}

const favicon = document.querySelector("#favicon")
let iconOne = true

const swapFavicon = () => {
  if (iconOne) {
    favicon.href = "data:image/png;base64,"
  }
  else {
    favicon.href = "data:image/png;base64,"
  }

  iconOne = !iconOne;
}


window.onload = () => {
  let myP5

  // for some reason this sketch causes the links on mobile to not work, so disable.
  if (!isMobileDevice()) {
    myP5 = new p5(sketchFn, 'p5-canvas')
  }

  const gifs = document.querySelectorAll(".gif")
  gl.gifLinks( gifs )

  if (!isMobileDevice()) {
    setInterval(swapFavicon, 1500)
  }
}